import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Partners = () => {
  const [partners, setPartners] = useState([]);

  useEffect(() => {
    // Effectuer une requête à l'API REST de WordPress pour récupérer les partenaires
    axios.get('http://cjezdhm.cluster029.hosting.ovh.net/wp-json/wp/v2/partners')
      .then(response => {
        setPartners(response.data);
      })
      .catch(error => {
        console.error('Erreur lors de la récupération des partenaires', error);
      });
  }, []);

  return (
    <div>
      <h2>Partenaires</h2>
      <div className="partners-list">
        {partners.map(partner => (
          <div key={partner.id}>
            <h3>{partner.title.rendered}</h3>
            {partner.acf && partner.acf.image && (
              <img src={partner.acf.image.url} alt={partner.title.rendered} />
            )}
            {/* Autres informations du partenaire si nécessaire */}
          </div>
        ))}
      </div>
    </div>
  );
};

export default Partners;
